% s_apox =  (s+ζ) / (s*ζ + 1)
function S_FOA = FOA(S, alpha, wc)
    zeta=tan(alpha*pi/2)+sec(alpha*pi/2);
    S_FOA = (S .* zeta ./ wc + 1) ./ (S ./ wc + zeta) ;
end
    

% H(s) = (s+z) / (s*z + 1) ~= 1/s^(α) = s^(-α)
H_vals = 1 ./ FOA(s_vals, alpha, wc);

% Convert to magnitude (dB) and phase (degrees)
magnitude_db = 20 * log10(abs(H_vals));
phase_deg = angle(H_vals) * 180/pi;

% Create Bode plot
figure(2);
subplot(2,1,1); %[output:6ca63881]
semilogx(w, magnitude_db); %[output:6ca63881]
grid on; %[output:6ca63881]
ylabel('Magnitude (dB)'); %[output:6ca63881]
title(sprintf('FOA Fractional-Order System: H(s) = s^{%.2f}', exponent)); %[output:6ca63881]

subplot(2,1,2); %[output:6ca63881]
semilogx(w, phase_deg); %[output:6ca63881]
