%[text] ## Error Calc (1% error bandwidth)
alpha = 0.5; %[control:slider:610a]{"position":[9,12]}
beta = 0; %[control:slider:5886]{"position":[8,9]}
range = logspace(-2, 9, 1000);
w = range;
wc_values = range;
s_vals = 1j * w;
accepted_error = 0.01; % 1% error

exponent = -(alpha + beta*1j);

% Initialize arrays for magnitude error bandwidth
foa_mag_band_low = nan(size(wc_values));
foa_mag_band_high = nan(size(wc_values));
foa_mag_bandwidth = nan(size(wc_values));
foa_mag_ratio = nan(size(wc_values));

soa_mag_band_low = nan(size(wc_values));
soa_mag_band_high = nan(size(wc_values));
soa_mag_bandwidth = nan(size(wc_values));
soa_mag_ratio = nan(size(wc_values));

% Initialize arrays for phase error bandwidth
foa_phase_band_low = nan(size(wc_values));
foa_phase_band_high = nan(size(wc_values));
foa_phase_bandwidth = nan(size(wc_values));
foa_phase_ratio = nan(size(wc_values));

soa_phase_band_low = nan(size(wc_values));
soa_phase_band_high = nan(size(wc_values));
soa_phase_bandwidth = nan(size(wc_values));
soa_phase_ratio = nan(size(wc_values));

% Initialize matrices for storing error data (for color plots)
rel_err_mag_fo_matrix = nan(numel(wc_values), numel(w));
rel_err_mag_so_matrix = nan(numel(wc_values), numel(w));
rel_err_phase_fo_matrix = nan(numel(wc_values), numel(w));
rel_err_phase_so_matrix = nan(numel(wc_values), numel(w));

for idx = 1:numel(wc_values)
    current_wc = wc_values(idx);

    H_frac = (s_vals ./ current_wc).^exponent;
    H_fo = 1 ./ FOA(s_vals, alpha, current_wc);
    H_so = 1 ./ SOA(s_vals, alpha, current_wc);

    % Calculate magnitude errors
    mag_frac = abs(H_frac);
    mag_fo = abs(H_fo);
    mag_so = abs(H_so);

    rel_err_mag_fo = abs(mag_fo ./ mag_frac - 1);
    rel_err_mag_so = abs(mag_so ./ mag_frac - 1);

    % Calculate phase errors (in degrees)
    phase_frac = angle(H_frac) * 180/pi;
    phase_fo = angle(H_fo) * 180/pi;
    phase_so = angle(H_so) * 180/pi;

    % Phase error as percentage of fractional phase
    rel_err_phase_fo = abs(phase_fo - phase_frac) ./ (abs(phase_frac) + eps) ;
    rel_err_phase_so = abs(phase_so - phase_frac) ./ (abs(phase_frac) + eps) ;

    % Store error values for color plots
    rel_err_mag_fo_matrix(idx, :) = rel_err_mag_fo;
    rel_err_mag_so_matrix(idx, :) = rel_err_mag_so;
    rel_err_phase_fo_matrix(idx, :) = rel_err_phase_fo;
    rel_err_phase_so_matrix(idx, :) = rel_err_phase_so;

    [~, center_idx] = min(abs(log10(w) - log10(current_wc)));

    % MAGNITUDE ERROR BANDWIDTH - FOA
    if rel_err_mag_fo(center_idx) <= accepted_error
        low_idx = center_idx;
        while low_idx > 1 && rel_err_mag_fo(low_idx - 1) <= accepted_error
            low_idx = low_idx - 1;
        end
        high_idx = center_idx;
        while high_idx < numel(w) && rel_err_mag_fo(high_idx + 1) <= accepted_error
            high_idx = high_idx + 1;
        end
        foa_mag_band_low(idx) = w(low_idx);
        foa_mag_band_high(idx) = w(high_idx);
        foa_mag_bandwidth(idx) = foa_mag_band_high(idx) - foa_mag_band_low(idx);
        foa_mag_ratio(idx) = foa_mag_band_high(idx) ./ foa_mag_band_low(idx);
    end

    % MAGNITUDE ERROR BANDWIDTH - SOA
    if rel_err_mag_so(center_idx) <= accepted_error
        low_idx = center_idx;
        while low_idx > 1 && rel_err_mag_so(low_idx - 1) <= accepted_error
            low_idx = low_idx - 1;
        end
        high_idx = center_idx;
        while high_idx < numel(w) && rel_err_mag_so(high_idx + 1) <= accepted_error
            high_idx = high_idx + 1;
        end
        soa_mag_band_low(idx) = w(low_idx);
        soa_mag_band_high(idx) = w(high_idx);
        soa_mag_bandwidth(idx) = soa_mag_band_high(idx) - soa_mag_band_low(idx);
        soa_mag_ratio(idx) = soa_mag_band_high(idx) ./ soa_mag_band_low(idx);
    end

    % PHASE ERROR BANDWIDTH - FOA
    if rel_err_phase_fo(center_idx) <= accepted_error
        low_idx = center_idx;
        while low_idx > 1 && rel_err_phase_fo(low_idx - 1) <= accepted_error
            low_idx = low_idx - 1;
        end
        high_idx = center_idx;
        while high_idx < numel(w) && rel_err_phase_fo(high_idx + 1) <= accepted_error
            high_idx = high_idx + 1;
        end
        foa_phase_band_low(idx) = w(low_idx);
        foa_phase_band_high(idx) = w(high_idx);
        foa_phase_bandwidth(idx) = foa_phase_band_high(idx) - foa_phase_band_low(idx);
        foa_phase_ratio(idx) = foa_phase_band_high(idx) ./ foa_phase_band_low(idx);
    end

    % PHASE ERROR BANDWIDTH - SOA
    if rel_err_phase_so(center_idx) <= accepted_error
        low_idx = center_idx;
        while low_idx > 1 && rel_err_phase_so(low_idx - 1) <= accepted_error
            low_idx = low_idx - 1;
        end
        high_idx = center_idx;
        while high_idx < numel(w) && rel_err_phase_so(high_idx + 1) <= accepted_error
            high_idx = high_idx + 1;
        end
        soa_phase_band_low(idx) = w(low_idx);
        soa_phase_band_high(idx) = w(high_idx);
        soa_phase_bandwidth(idx) = soa_phase_band_high(idx) - soa_phase_band_low(idx);
        soa_phase_ratio(idx) = soa_phase_band_high(idx) ./ soa_phase_band_low(idx);
    end
end

