%[text] ## PLL Simulation with Three Filter Types
% clear; clc;
% 
% %% Filter Design Parameters
% alpha = 0.5; %[control:slider:397f]{"position":[11,14]}
% beta = 0; %[control:slider:89b0]{"position":[10,11]}
% wc =1.01; %[control:slider:6aa6]{"position":[7,11]}
% 
% %% Simulation Parameters
% fs = 10000;
% dt = 1/fs;
% t = 0:dt:1;
% 
% %% Input signal parameters
% f_input = 100;   
% SNR_dB = 10;
% 
% % input signal with noise
% input_signal = sin(2*pi*f_input*t);
% noise = randn(size(t));
% noise_power = var(input_signal) / (10^(SNR_dB/10));
% noise = noise * sqrt(noise_power);
% noisy_input = input_signal + noise;
% 
% %% PLL Parameters
% Kd = 1;
% Kv = 50;
% f_vco_free = 95;
% 
% %% Create Transfer Functions for Each Filter
% 
% % Filter 1: Fractional Order (Ideal)
% exponent = -(alpha + beta*1j);
% w_design = logspace(-2, 2, 1000);
% s_design = 1j * w_design;
% H_fractional = (s_design./wc).^exponent;
% 
% % Filter 2: First Order Approximation (FO)
% aprox_var = tan(alpha*pi/2) + sec(alpha*pi/2);
% s_design_new_FO = (s_design .* aprox_var ./ wc + 1) ./ (s_design ./ wc + aprox_var);
% H_FO = 1 ./ s_design_new_FO;
% 
% % Filter 3: Second Order Approximation (SO)
% aprox_var_0 = alpha^alpha + 2.*alpha + 1;
% aprox_var_2 = alpha^alpha - 2.*alpha + 1;
% aprox_var_1 = (aprox_var_2 - aprox_var_0) .* tan((2 + alpha) .* pi./4);
% s_design_center = s_design ./ wc;
% s_design_new_SO = (aprox_var_0 .* s_design_center.^2 + aprox_var_1 .* s_design_center + aprox_var_2)./(aprox_var_2 .* s_design_center.^2 + aprox_var_1 .* s_design_center + aprox_var_0);
% H_SO = 1 ./ s_design_new_SO;
% 
% %% Convert Filters to Rational Transfer Functions for Simulation
% 
% % For FO approximation: H(s) = (s/wc + aprox_var) / (s*aprox_var/wc + 1)
% num_FO = [1/wc, aprox_var];
% den_FO = [aprox_var/wc, 1];
% 
% % For SO approximation
% num_SO = [aprox_var_2/wc^2, aprox_var_1/wc, aprox_var_0];
% den_SO = [aprox_var_0/wc^2, aprox_var_1/wc, aprox_var_2];
% 
% % Convert to discrete time using bilinear transformation
% [num_FO_z, den_FO_z] = bilinear(num_FO, den_FO, fs);
% [num_SO_z, den_SO_z] = bilinear(num_SO, den_SO, fs);
% 
% % Display filters
% fprintf('First Order Approximation H(s):\n');
% H_FO_tf = tf(num_FO, den_FO);
% disp(H_FO_tf);
% 
% fprintf('\nSecond Order Approximation H(s):\n');
% H_SO_tf = tf(num_SO, den_SO);
% disp(H_SO_tf);
% 
% %% Plot Bode Diagrams
% figure('Position', [100, 100, 1200, 500]);
% 
% % Calculate magnitude and phase
% magnitude_db_fractional = 20 * log10(abs(H_fractional));
% magnitude_db_FO_calc = 20 * log10(abs(H_FO));
% magnitude_db_SO_calc = 20 * log10(abs(H_SO));
% phase_deg_fractional = angle(H_fractional) * 180/pi;
% phase_deg_FO_calc = angle(H_FO) * 180/pi;
% phase_deg_SO_calc = angle(H_SO) * 180/pi;
% 
% subplot(2,1,1);
% semilogx(w_design, magnitude_db_fractional, 'k-', 'LineWidth', 2, 'DisplayName', 'Fractional (Ideal)');
% hold on;
% semilogx(w_design, magnitude_db_FO_calc, 'b--', 'LineWidth', 1.5, 'DisplayName', 'FO Approx');
% semilogx(w_design, magnitude_db_SO_calc, 'r-.', 'LineWidth', 1.5, 'DisplayName', 'SO Approx');
% line([wc wc], ylim, 'Color', 'g', 'LineStyle', '--', 'DisplayName', 'ω_c');
% hold off;
% grid on;
% ylabel('Magnitude (dB)');
% title(sprintf('Filter Frequency Response: α = %.2f, ω_c = %.2f rad/s', alpha, wc));
% legend('Location', 'best');
% 
% subplot(2,1,2);
% semilogx(w_design, phase_deg_fractional, 'k-', 'LineWidth', 2);
% hold on;
% semilogx(w_design, phase_deg_FO_calc, 'b--', 'LineWidth', 1.5);
% semilogx(w_design, phase_deg_SO_calc, 'r-.', 'LineWidth', 1.5);
% hold off;
% grid on;
% ylabel('Phase (degrees)');
% xlabel('Frequency (rad/s)');
% 
% %% Run PLL Simulation for Each Filter
% 
% % Preallocate storage
% results = struct();
% filter_names = {'FO', 'SO'};
% filter_nums = {num_FO_z, num_SO_z};
% filter_dens = {den_FO_z, den_SO_z};
% 
% for f_idx = 1:length(filter_names)
%     filter_name = filter_names{f_idx};
%     num_z = filter_nums{f_idx};
%     den_z = filter_dens{f_idx};
% 
%     % Initialize PLL variables
%     vco_phase = 0;
%     vco_out = zeros(size(t));
%     phase_error = zeros(size(t));
%     filter_out = zeros(size(t));
%     pd_output = zeros(size(t));
% 
%     % Initialize filter states
%     zi = zeros(max(length(num_z), length(den_z))-1, 1);
% 
%     % PLL Loop
%     for i = 1:length(t)
%         % Phase detector (multiplier type)
%         pd_output(i) = noisy_input(i) * vco_out(i);
% 
%         % Loop filter
%         [filter_out(i), zi] = filter(num_z, den_z, pd_output(i), zi);
% 
%         % VCO
%         vco_freq = f_vco_free + Kv * filter_out(i);
%         vco_phase = vco_phase + 2*pi*vco_freq*dt;
% 
%         % Generate VCO output for next iteration
%         if i < length(t)
%             vco_out(i+1) = sin(vco_phase);
%         end
%     end
% 
%     % Store results
%     results.(filter_name).vco_out = vco_out;
%     results.(filter_name).filter_out = filter_out;
%     results.(filter_name).pd_output = pd_output;
%     results.(filter_name).phase_error = phase_error;
% end
% 
% %% Plot PLL Results
% figure('Position', [100, 100, 1400, 1000]);
% 
% % Plot for FO filter
% subplot(2,2,1);
% idx = t <= 0.2;
% plot(t(idx), input_signal(idx), 'k', 'LineWidth', 1.5);
% hold on;
% plot(t(idx), noisy_input(idx), 'Color', [0.7 0.7 0.7], 'LineWidth', 0.5);
% plot(t(idx), results.FO.vco_out(idx), 'b', 'LineWidth', 1.5);
% hold off;
% xlabel('Time (s)');
% ylabel('Amplitude');
% title('FO Filter: Input vs Output (First 0.2s)');
% legend('Clean Input', 'Noisy Input', 'VCO Output');
% grid on;
% 
% subplot(2,2,2);
% idx = t <= 0.2;
% plot(t(idx), input_signal(idx), 'k', 'LineWidth', 1.5);
% hold on;
% plot(t(idx), noisy_input(idx), 'Color', [0.7 0.7 0.7], 'LineWidth', 0.5);
% plot(t(idx), results.SO.vco_out(idx), 'r', 'LineWidth', 1.5);
% hold off;
% xlabel('Time (s)');
% ylabel('Amplitude');
% title('SO Filter: Input vs Output (First 0.2s)');
% legend('Clean Input', 'Noisy Input', 'VCO Output');
% grid on;
% 
% % Full signal comparison
% subplot(2,2,3);
% plot(t, input_signal, 'k', 'LineWidth', 1);
% hold on;
% plot(t, results.FO.vco_out, 'b--', 'LineWidth', 1);
% hold off;
% xlabel('Time (s)');
% ylabel('Amplitude');
% title('FO Filter: Full Signal');
% legend('Input', 'VCO Output');
% grid on;
% 
% subplot(2,2,4);
% plot(t, input_signal, 'k', 'LineWidth', 1);
% hold on;
% plot(t, results.SO.vco_out, 'r--', 'LineWidth', 1);
% hold off;
% xlabel('Time (s)');
% ylabel('Amplitude');
% title('SO Filter: Full Signal');
% legend('Input', 'VCO Output');
% grid on;
% 
% 
% 
% %% Calculate Performance Metrics
% fprintf('\n=== PLL Performance Analysis ===\n');
% for f_idx = 1:length(filter_names)
%     filter_name = filter_names{f_idx};
% 
%     % Lock detection
%     lock_threshold = 0.1;
%     filter_final = mean(results.(filter_name).filter_out(end-100:end));
%     locked_idx = find(abs(results.(filter_name).filter_out - filter_final) < lock_threshold, 1);
% 
%     fprintf('\n%s Filter:\n', filter_name);
%     if ~isempty(locked_idx)
%         fprintf('  Lock time: %.4f seconds\n', t(locked_idx));
%     else
%         fprintf('  Did not lock\n');
%     end
% 
%     % Frequency error
%     final_vco_freq = f_vco_free + Kv * filter_final;
%     freq_error = abs(final_vco_freq - f_input);
%     fprintf('  Frequency error: %.4f Hz\n', freq_error);
% 
% 
% end

%%
%[text] ## simulink
alpha = 0.5;
SNR_dB = 20;
gain = 10;
input_freq=10;
zeta = tan(alpha*pi/2)+sec(alpha*pi/2);
a0 = alpha^alpha + 2.*alpha + 1;
a2 = alpha^alpha - 2.*alpha + 1;
a1 = (a2 - a0) .* tan((2 + alpha) .* pi./4);
wc = 10;a
w = 10;

